import React, { Component } from 'react';
import BigCalendar from 'react-big-calendar';
import moment from 'moment';
import './App.css';

const localizer = BigCalendar.momentLocalizer(moment); 

class App extends Component {
  render() {
    return (
      <div className="App">
        <BigCalendar/>
      </div>
    );
  }
}

export default App;
